import React from "react";
import { Container, Row, Col } from "reactstrap";
import { Link } from "react-router-dom";
const ThankYou = () => {
  return (
    <section>
      <Container>
        <Row>
          <Col lg="12">
            <div className="thank__you">
              <span>
                <i class="ri-check-line"></i>
              </span>
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};
export default ThankYou;
